    const userId = useSelector( state => state.userTokener._userId )
    console.log("user id :: ",userId)
    const dispatch = useDispatch()
    useEffect(() => {
      dispatch(viewBook(userId))
    })
    return(<>
      Bookings Page

    </>)
 }

